import React from 'react';


const Rank = ({ food }) => {
    return (
        <div>
            <div className='f3'>
                {food}
            </div>
            <div className='f1'>
                {'Sophie, your current rank is...'}{'5'}
            </div>
        </div>
    );
}

export default Rank;
